		String reqXml = "<soapenv:Envelope xmlns:soapenv=\"http://schemas.xmlsoap.org/soap/envelope/\" xmlns:web=\"http://webservice/\">" + 
				"   <soapenv:Header/>" + 
				"   <soapenv:Body>" + 
				"      <web:"+method+">" + 
				"         <!--Optional:-->" + 
				"         <arg0><![CDATA["
				+param
				+ "]]></arg0>" + 
				"      </web:"+method+">" + 
				"   </soapenv:Body>" + 
				"</soapenv:Envelope>";
		SoapResponseVo respVo = HttpRequestBus.create(url, RequestType.soap1)
				.setParam(reqXml)
				.send();
